INSERT INTO `cms_article` VALUES ('1', '3', '网站简介1', '', 'red', '/userfiles/1/_thumbs/images/Ubuntu-default%20(4).jpg', '电影,出版商', '市场日渐红火，新导演也有了更多的空间，无奈这个故事本身稍敏感，所以还是没有&lt;span class=&quot;highlight&quot;&gt;成功&lt;/span&gt;。我又把这个故事写成小说出版，那本小说就是《1988我想和这个世界谈谈》。\r\n\r\n	这些天，不少朋友和媒体来问关于《后会无期》的情况，写一篇短文，告诉大家一些故事和想法', '999', null, '77', ',1,2,', '', '', '1', '2016-02-04 12:49:55', '3038a878f1544ec9a919c8f4cf935832', '2016-02-26 16:17:11', null, '0');
