INSERT INTO `exam_paper` VALUES ('6b9256a6924f4fdcae678ae64722d051', '2016-02-17 17:35:08', '0', 'volatile关键字虽然从字面上理解起来比较简单，但是要用好不是一件容易的事情。由于volatile关键字是与Java的内存模型有关的，因此在讲述volatile关键之前，我们先来了解一下与内存模型相关的概念和知识，然后分析了volatile关键字的实现原理，最后给出了几个使用volatile关键字的场景。', '2016-02-24 17:49:17', '1', '1', '测试卷3', '90');
